DECLARE @UserCredentialsImport
 TABLE (
 UserCredentialID bigint NULL,
 UserGUID varchar(352) NULL,
 CredentialID varchar(429) NULL,
 LicenseNbr varchar(88) NULL,
 StateIssuedByID varchar(22) NULL,
 LicenseIssueDate date NULL,
 LicenseExpirationDate date NULL,
 IsActive bigint NULL,
 ModifiedOn datetime NULL,
 ModifiedBy bigint NULL,
 CreatedOn datetime NULL,
 CreatedBy bigint NULL,
 SystemCreatedOn datetime NULL,
 SystemModifiedOn datetime NULL
)

	[UserID],
	[CredentialID],
	[LicenseNbr],
	[StateIssuedByID],
	[LicenseIssueDate],
	[LicenseExpirationDate],
	[IsActive],
	[ModifiedBy],
	[ModifiedOn]
)
SELECT 
	UserID, 
	C.CredentialID, 
	LicenseNbr, 
	SP.StateProvinceID, 
	CASE LicenseIssueDate WHEN '' THEN NULL ELSE LicenseIssueDate END AS LicenseIssueDate, 
	CASE LicenseExpirationDate WHEN '' THEN NULL ELSE LicenseExpirationDate END AS LicenseExpirationDate,
	1 As IsActive, 
	1 AS ModifiedBy, 
	GETUTCDATE() AS ModifiedOn
FROM 
	Core.Users INNER JOIN @UserCredentialsImport IT 
		ON Users.UserGUID = IT.UserGUID 
	INNER JOIN Reference.[Credentials] C
		ON IT.CredentialID = C.CredentialName
	LEFT JOIN Reference.StateProvince SP 
		ON IT.StateIssuedByID = SP.StateProvinceCode


GO
